import React, { FC } from "react";
import { CompResult, SubjectProperty } from "../types";
import FeedbackForm from "./FeedbackForm.tsx";

interface Props {
  subject: SubjectProperty;
  results: CompResult[];
}

const Results: FC<Props> = ({ subject, results }) => {
  return (
    <div>
      <h2>Top 3 Comparable Properties</h2>
      {results.length === 0 ? (
        <p>No results yet.</p>
      ) : (
        <ol>
          {results.map((comp) => (
            <li key={comp.id} style={{ marginBottom: "1.5rem" }}>
              <strong>{comp.address}</strong> â€” Score: {comp.score.toFixed(2)}
              {comp.explanation && (
                <ul>
                  {Object.entries(comp.explanation).map(([key, val]) => (
                    <li key={key}>
                      <em>{key}</em>: {val.toFixed(3)}
                    </li>
                  ))}
                </ul>
              )}
              <FeedbackForm subject={subject} comp={comp} />
            </li>
          ))}
        </ol>
      )}
    </div>
  );
};

export default Results;
